import { useState } from "react";
import "./App.css";
import Data from "./Data.json";
import React from "react";

function App() {
  return (
    <div>
      <input type='text' placeholder='search' id='search-bar' />
      {Data.map((val, key) => {
        return (
          <div>
            <p key={key}>{val.name}</p>
          </div>
        );
      })}
    </div>
  );
}

export default App;
